script: |
  super -f text -I q111.spq | sort > q111.out

inputs:
  - name: q111.spq
    data: |
      SELECT + + ( - 93 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( - col1, + 18 * - col1 * 87 );
  - name: tab2

outputs:
  - name: q111.out
    data: |
      -93
      -93
      -93
